import React from 'react';
import { ExternalLink, Github } from 'lucide-react';

const ProjectGrid = ({ projects, openProjectModal }) => {
  return (
    <div className="grid grid-cols-3 gap-4">
      {projects.map((project) => (
        <div
          key={project.id}
          className="aspect-square bg-gray-800 rounded-lg overflow-hidden shadow-lg hover:shadow-2xl transition-all duration-300 cursor-pointer"
          onClick={() => openProjectModal(project)}
        >
          <div className="w-full h-full p-4 flex flex-col items-center justify-center text-center">
            <div className="w-16 h-16 mb-4 flex items-center justify-center">
              <img
                src={project.imageUrl}
                alt={project.title}
                className="max-w-full max-h-full object-contain"
              />
            </div>
            <h3 className="text-lg font-semibold mb-2 text-purple-300">{project.title}</h3>
            <p className="text-sm text-gray-400 line-clamp-3">{project.description}</p>
            <div className="mt-4 flex justify-center space-x-2">
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  openProjectModal(project);
                }}
                className="text-purple-400 hover:text-purple-300 transition-colors duration-300"
              >
                <ExternalLink size={18} />
              </button>
              {project.githubUrl && (
                <a
                  href={project.githubUrl}
                  target="_blank"
                  rel="noopener noreferrer"
                  onClick={(e) => e.stopPropagation()}
                  className="text-gray-400 hover:text-white transition-colors duration-300"
                >
                  <Github size={18} />
                </a>
              )}
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ProjectGrid;
